<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Quill 富文本编辑器及上传到 GitHub</title>
    <!-- Quill 样式 -->
    <link href="https://cdn.quilljs.com/1.3.6/quill.snow.css" rel="stylesheet">
    <style>
        #editor-container {
            height: 300px;
        }
        /* 其他样式可以根据需要添加 */
        .ql-toolbar.ql-snow {
            border: 1px solid #ccc;
        }
    </style>
</head>
<body>
    <h1>Quill 富文本编辑器</h1>
    
    <!-- 文件名前缀下拉选择框 -->
    <label for="file-prefix">请选择你的文章分区:</label>
    <select id="file-prefix">
        <option value="精简版windows镜像分享">精简版windows镜像</option>
        <option value="pe系统分享">pe系统</option>
        <option value="liunx系统分享">liunx系统</option>
        <option value="虚拟机资源分享">虚拟机资源</option>
    </select>

    <!-- 自定义文件名输入框 -->
    <label for="file-name-custom">选择你的文章标题:</label>
    <input type="text" id="file-name-custom" placeholder="请输入......">

    <!-- 编辑器容器 -->
    <div id="editor-container"></div>

    <!-- 按钮：导出并上传到 GitHub -->
    <button id="export-and-upload-button">上传文章</button>
    
    <!-- JSON 输出预览 -->
    <pre id="json-output"></pre>

    <!-- Quill JS -->
    <script src="https://cdn.quilljs.com/1.3.6/quill.js"></script>
